    Roles["GRAPHICS_OBJECT"] = "graphics-object";
    Roles["GRAPHICS_SYMBOL"] = "graphics-symbol";
    Roles["GROUP"] = "group";
    Roles["DOCUMENT"] = "document";
})(Roles || (Roles = {}));
